import React from "react";

function Footer() {
  return (
    <footer class="footer font-small  bg-dark text-white position-absolute w-100">
      <div class="text-center p-2">
        Test FrontEnd Developer Footer
        <p>Diego Betancourt</p>
      </div>
    </footer>
  );
}

export default Footer;
